import React from "react";
import "./Home.css";

function Home() {
  return (
    <div>
      <header classname="the-header">
        <h1 id="my-name"> Eric Chen </h1>
        <div id="expansion">
          <a
            id="resume"
            href="EricChen_Resume.pdf"
            rel="noreferrer noopener"
            target="_blank"
          >
            My Resume
          </a>
        </div>
      </header>
    </div>
  );
}

export default Home;
